import styled from "styled-components";

export const SwiperContainer = styled.div`
  width: 100%;
  height: 100%;
  font-family: Lato;
`;

export const SwiperSlide = styled.div`
  text-align: center;
  font-size: 18px;
  background: #fff;
  display: flex;
  justify-content: center;
  align-items: center;
`;

export const SlideImage = styled.img`
  display: block;
  width: 100%;
  height: 100%;
  object-fit: cover;
`;
